m=A.axL('The National School of Advanced Sciences and Technologies in Borj C\xe9dria (ENSTABC), in collaboration with ETC Junior Enterprise (Energetic Technologies Consulting), organized a prestigious business forum that included an exhibition and networking area, workshops, and a panel discussion.\n\nIn this context, they are delighted to extend an invitation to students from all over the country, representing various schools, to visit our institution and participate in the panel discussion titled "When Digital Technology Embraces Sustainability for a Responsible and Lasting Transformation." \n\nThe event aims to explore the intriguing intersection of digital innovation and environmental consciousness, underscoring the transition towards sustainable and responsible practices. Students have a unique opportunity to engage with industry leaders, experts, and fellow attendees, thereby fostering valuable connections and gaining insightful perspectives.',$.aGa(),"assets/associations/etc/events/4 annuel/etc_forum1.jpg",p,o,n,m,"Forum 4")
